import React from 'react'

function traverse(props) {
  if (props.node !== null) {
    return (
      <div>
        <div
          style={{
            width: "20px",
            height: "20px",
            marginLeft: "50%",
            marginBottom: "7px",
            border: "2px solid black",
            borderRadius: "5px",
          }}>
          {props.node.value}
        </div>
        <div
          style={{
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-evenly",
          }}>
          <div style={{ marginRight: "5px" }}>{traverse(props.node.left)}</div>
                <div><traverse node={props.node.right}/></div>
        </div>
      </div>
    );
  }
}

export default traverse
